import React, { useState, useEffect } from 'react';
import {
  Box, ButtonGroup, Button, Heading, HStack, Flex, Image, Stack, Text, Input, InputGroup, Avatar, Textarea,
  Step, StepDescription, StepIcon, StepIndicator, StepNumber, StepSeparator, StepStatus, StepTitle, Stepper, useSteps, useColorModeValue,
} from '@chakra-ui/react';
import { useRecoilState } from 'recoil';
import { formDataState, fetchedDataState } from '../../components/recoilAtoms';
import Form1 from './form1';
import Form2 from './form2';
import Form3 from './form3';
import jsPDF from 'jspdf'

export default function CanAm() {

  // ------- print pdf --------
  function ModifyPdf() {

    const doc = new jsPDF();
    // base sheet
    const img = 'data:image/jpeg;base64,'

    var width = doc.internal.pageSize.getWidth()
    var height = doc.internal.pageSize.getHeight()
    doc.addImage(img, 'JPEG', 0, 0, width, height);

    // Set the font size and text alignment for form field values
    doc.setFontSize(9);

    // Fill in the form field values
    doc.text(42, 40, `${formData.name}`); // Name field
    doc.text(136, 40, `${formData.phone}`); // Phone field
    doc.text(100, 50, `${formData.email}`); // Email field
    doc.text(31, 60, `${formData.address}`); // Address field
    doc.text(12, 82, `${formData.year}`); // Year field

    doc.text(42, 129, `${formData.stockNum}`); // StockNum field
    doc.text(22, 170, `${formData.trade}`); // Trade field
    doc.text(31, 153, `${formData.deposit}`); // Deposit field
    doc.text(15, 201, `${formData.options}`); // Accessories field
    doc.text(118, 88, `${fetchedData.msrp}`); // Accessories field
    doc.text(188, 75, `${fetchedData.freight}`); // Accessories field
    doc.text(188, 83, `${fetchedData.commodity}`); // Accessories field
    doc.text(188, 91, `${fetchedData.pdi}`); // Accessories field

    doc.text(12, 98, `${fetchedData.model1}`); // Accessories field
    doc.text(42, 121, `${fetchedData.modelCode}`); // Accessories field
    doc.text(42, 104, `${fetchedData.color}`); // Accessories field

    // Save the filled PDF document
    doc.save((`${formData.name}.pdf`));
  };

  //-----------
  const [step, setStep] = useState(1);
  const [progress, setProgress] = useState(0);
  const [formData, setFormData] = useRecoilState(formDataState);
  const [fetchedData, setFetchedData] = useRecoilState(fetchedDataState);

  useEffect(() => {
    if (formData.model) {
      fetchData();
    }
  }, [formData.model]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleBack = () => {
    setStep(step - 1);
    setProgress(progress - 33.33);
  };

  const handleNext = () => {
    if (step === 3) {
      // Navigate to the CanAm2 page
    } else {
      setStep(step + 1);
      setProgress(progress + 33.33);
      if (step === 2) {
        fetchData();
      }
    }
  };

  const fetchData = () => {
    fetch(`http://localhost:3000/api/models/${formData.model}`)
      .then((response) => response.json())
      .then((data) => {
        setFetchedData(data);
      })
      .catch((error) => {
        console.error('Error:', error.message);
      });
  };

  return (
    <>
      <form>
        <Box borderWidth="1px"
          rounded="lg"
          shadow="1px 1px 3px rgba(0,0,0,0.3)"
          maxWidth={650}
          p={6}
          m="10px auto"
          as="form">
         
          {step === 1 ? <Form1 /> : step === 2 ? <Form2 /> : <Form3 />}
          <ButtonGroup mt="5%" w="100%">
            <Flex w="100%" justifyContent="space-between">
              <Flex>
                <Button
                  onClick={handleBack}
                  isDisabled={step === 1}
                  colorScheme="teal"
                  variant="solid"
                  w="7rem"
                  mr="5%">
                  Back
                </Button>
                <Button
                  w="7rem"
                  isDisabled={step === 3}
                  onClick={handleNext}

                  colorScheme="teal"
                  variant="outline">
                  Next
                </Button>
              </Flex>
              {step === 3 ? (
                <Button
                  w="7rem"
                  colorScheme="teal"
                  variant="outline"
                  onClick={ModifyPdf}
                >
                  Print
                </Button>
              ) : null}
            </Flex>
          </ButtonGroup>
        </Box>

        <Box w="100%" textAlign={'center'} fontWeight="normal" mb="2%"
          borderWidth="1px"
          rounded="lg"
          shadow="1px 1px 3px rgba(0,0,0,0.3)"
          maxWidth={350}
          p={6}
          m="10px auto"
          as="form">
            <Box w="100%" h="100%"
              bg={useColorModeValue('white', 'gray.800')}
              boxShadow={'2xl'}
              rounded={'md'}
              overflow={'hidden'}>
              <Image
                h={'120px'}
                w={'full'}
                src={
                  'https://can-am.brp.com/content/dam/global/en/can-am-off-road/my22/photos/lifestyle/ORV-SSV-MY21-Lifestyle-Scouting-DSCF8693-RGB-6240x3512-1600x1600.jpeg'
                }
                objectFit={'cover'}
              />
              <Flex justify={'center'} mt={-12}>
                <Avatar
                  size={'xl'}
                  src={
                    'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?ixlib=rb-1.2.1&q=80&fm=jpg&crop=faces&fit=crop&h=200&w=200&ixid=eyJhcHBfaWQiOjE3Nzg0fQ'
                  }
                  alt={'Author'}
                  css={{
                    border: '2px solid white',
                  }}
                />
              </Flex>

              <Box p={6}>
                <Stack spacing={0} align={'center'} mb={5}>
                  <Heading fontSize={'2xl'} fontWeight={500} fontFamily={'body'}>

                  </Heading>
                  <Text color={'gray.500'}>{formData.name}</Text>
                </Stack>

                <Text color={'gray.500'}>Phone: {formData.phone}</Text>
                <Text color={'gray.500'}>Email: {formData.email}</Text>
                <Text color={'gray.500'}>Address: {formData.address}</Text>
              </Box>
            </Box>
        </Box>
      </form>
    </>
  );
}